import React from "react";

const LoginForm = ({isShowLogin}) => {

  const handleSignUp = (e) => {
      e.preventDefault()
      isShowLogin.handleSignUpLink();
   }

  return (
    <div className={`${!isShowLogin ? "active" : ""} show`}>
      <div className="loginform">
        <div className="form-box solid">
          <form>
            <h1 className="login-text">Login</h1>
            <label className = "login-label">Username/Email</label>
            <br></br>
            <input type="text" name="username" className="login-box"></input>
            <br></br>
            <label className = "login-label">Password</label>
            <br></br>
            <input
              type="password"
              name="password"
              className="login-box"
            ></input>
            <br></br>
            <input type="submit" value="Submit" className="login-btn" />
            <label className = "login-label">Don't have an Account?</label>
            <input type="submit" value="SignUp" className="login-btn1" onClick = {handleSignUp} />
          </form>
        </div>
      </div>
    </div>
  );
};

export default LoginForm;
